import { createContext, useState } from "react";
import { ICars } from "../types/types";

type CarsContextProviderProps = {
  children: React.ReactNode
}

export const Context = createContext(null);

export const CarsContextProviderProps = ({children}: CarsContextProviderProps) => {
  const [contextState, setContextState] = useState<ICars[]>(() => JSON.parse(localStorage.getItem('cars') || '[]'));

}
